import React, { useState } from "react";
import About from "./components/About";
import Header from "./components/Header";
import Nav from "./components/Nav";

function App() {
  const [categories] = useState([
    {
      name: "About Me", //this is the name of the link
      label: "About", //this is the label that will be displayed in the navbar
    },
    {
      name: "Portfolio",
      label: "Portfolio",
    },
    {
      name: "Contact",
      label: "Contact",
    },
    {
      name: "Resume",
      label: "Resume",
    },
  ]);

  const [currentCategory, setCurrentCategory] = useState(categories[0]); //what does [0] do?
  //it will set the current category to the first category in the array which is "About Me"
  //so when page loads it will display the About Me page

  return (
    //make a div styled with tailwind
    <div>
      <Header></Header>
      <Nav
        categories={categories} //this is essentially going to be put into the nav component as props
        setCurrentCategory={setCurrentCategory}
        currentCategory={currentCategory}
      ></Nav>
      <main>
        <About></About>
      </main>
    </div>
  );
}

export default App;
